function countTriplets(arr, r) {
    let numbers = new Map();

    for(let i=0; i<arr.length; i++) {
        let locations = numbers.get(arr[i])
        if(!locations) {
            numbers.set(arr[i], [i]);
        } else {
            locations.push(i);
            numbers.set(arr[i], locations);
        }
    }

    let triplets = 0;
    for(let i=0; i<arr.length; i++) {
        let number = arr[i];
        let secondNumber = (number * r);
        let thirdNumber = (secondNumber * r);

        let secondNumberLocations = numbers.get(secondNumber);
        let thirdNumberLocations = numbers.get(thirdNumber);

        if(i==0) {
            console.log(`number: ${number} + secondNumber: ${secondNumber} thirdNumber: ${thirdNumber}`);
            // console.log(`secondNumberLocations: ${secondNumberLocations.length}`);
            // console.log(`thirdNumberLocations: ${thirdNumberLocations.length}`);
            console.log("Typeof: " + typeof secondNumber)
        }
        if(secondNumberLocations && thirdNumberLocations) {
            triplets += secondNumberLocations.length * thirdNumberLocations.length;
        }
    }

    let tempTotal = 0;

    numbers.forEach((value, key)=> {
        console.log("Key: " + key + " length: " + value.length);
        console.log("typeof key: " + typeof key);
        tempTotal += value.length;
    })

    console.log(triplets, tempTotal);
}

